import React from 'react'
import Post from '../Post'
    
    
const fetchPosts = async () => {
        let response = await fetch(`https://studapi.teachmeskills.by/blog/posts/?limit=10`)
        let data = await response.json();
        let dataResult = data.results
        arrPost.push(dataResult)
}

const PostList = () => {
    let arrPost = []
    const fetchPost = () => {
        fetch(`https://studapi.teachmeskills.by/blog/posts/?limit=10`)
        .then((data) => {data.json()})
        .then((result) => {arrPost.push(result)})
    }

  return (
    <div className='PostList'>
        {arrPost.map(({title, text, date, img, id})=>{
            <Post key={id} title={title} text={text} date={date} img={img}/>
        })}
    </div>
    
  )
}


export default PostList
